using System.Threading.Tasks;
using Goblin.Service_Resource.Share;
using Goblin.Service_Resource.Share.Models;
using NUnit.Framework;

namespace Goblin.Service_Resource.Test
{
    public class FileServiceTest
    {
        [SetUp]
        public void Setup()
        {
            GoblinResourceHelper.Domain = "http://localhost:8001";
        }

        [Test]
        public async Task UploadTest()
        {
            var uploadFileModel = new GoblinResourceUploadFileModel
            {
                Folder = "test",
                Name = "test file.png",
                CreatedBy = -1,
                ContentBase64 = "",
                IsEnableCompressImage = true,
                ImageMaxHeightPx = 200,
                ImageMaxWidthPx = 200
            };

            var fileModel = await GoblinResourceHelper.UploadAsync(uploadFileModel).ConfigureAwait(true);
            
            Assert.IsNotNull(fileModel);
        }
        
        [Test]
        public async Task GetTest()
        {
            var slug = "test/cngycezzahw-i-#2b181b-w200-h113-test-file-png.png";
            
            var fileModel = await GoblinResourceHelper.GetAsync(slug).ConfigureAwait(true);

            Assert.IsNotNull(fileModel);
        }
        
        [Test]
        public async Task DeleteTest()
        {
            var slug = "test/cngycezzahw-i-#2b181b-w200-h113-test-file-png.png";

            await GoblinResourceHelper.DeleteAsync(slug).ConfigureAwait(true);

            Assert.Pass();
        }
    }
}